  false,\n\t\"url\": null,\n\t\"notes\": \"These files contain rectified digital vector
  terrain model data. The vector files are uncompressed complete with coordinate information.
  The VBMP project encompasses the entire land area of the Commonwealth of Virginia.
  The State boundary is buffered by 1000 feet. Coastal areas of the State bordering
  the Atlantic Ocean or the Chesapeake Bay are buffered by 1000 feet or the extent
  of man-made features extending from shore. All hydrographic features are collected
  if they contain water. Streams will be single line up to 8 feet wide for 100 scale
  or 30' for 200 and 400 scale. Digital Terrain Data to generate 1-foot resolution
  digital orthoimagery was developed over the majority of urban/suburban areas of
  the Commonwealth covering approximately 7,167 square miles and for 2-foot resolution
  digital orthoimagery over the rural areas of the Commonwealth covering approximately
  31,923 square miles as defined by VGIN. Digital Terrain Model data to develop 6-inch
  resolution digital orthoimagery was generated in limited urban areas covering approximately
  1000 square miles. This version of the VBMP metadata accompanies initial data distribution.
  Updated metadata for this dataset will be maintained on the VGIN web site at the
  following address: http://www.vgin.state.va.us/VBMP/VBMP.html.\",\n\t\"license_title\":
